Text:
Hello, är det några som har trubbel med filmen!?
Tanka hem senaste Nero, starta Nero, välj DVD och sedan DVD-video! I vänstra kolumnen dyker det upp två mappar, öppna den röda VIDEO_TS!  Leta reda på mappen "Men on fire" , öppna den mappen och dra över allt du hittar i den  till kolumnen höger om den röda VIDEO_TS mappen! Då hamnar allt inkl. subtitles och allt annat skit som behövs för att se filmen, i just VIDEO_TS mappen! Bränn skivan och det ska fungera....  Funkar inte detta så har ni nog fel på era program eller datorer för jag har nog brännt 6-7 kopior av filmen på detta sättet!!!!
///Kaya........
